import { beginCell, Cell } from "@ton/core";
import { ElectorData, loadElectorData, storeElectData } from "./data";

describe("elector data", () => {
  const data = Cell.fromBase64(
    ``,
  );

  it("should be parsed", () => {
    const electorData: ElectorData = loadElectorData(data.beginParse());

    expect(electorData).toBeDefined();

    const storedData = beginCell().store(storeElectData(electorData)).endCell();

    expect(data.hash().equals(storedData.hash())).toBe(true);
  });
});
